import React from 'react';
import PlayCard from '../../my-broadway-app/src/components/PlayCard';

function Wishlist({ wishlist, removeFromWishlist }) {
  return (
    <div>
      <h2>Your Wishlist</h2>
      {wishlist.map(play => (
        <PlayCard
          key={play.id}
          play={play}
          addToWishlist={() => {}}
          deletePlay={() => {}}
          removeFromWishlist={removeFromWishlist}
        />
      ))}
    </div>
  );
}

export default Wishlist;
